import styled from 'styled-components'

export const Wrapper = styled.div`
    height: 100%;
    width: 100hv;
    border: 1px solid;
    margin 5px;
`;

export const CalendarHead= styled.div`
    width: 100%;
    height: 40 px;
    display: flex;
    justify-content: space-around;
    align-items: center;
    font-size: 24px;
`;

export const SevenColGrid = styled.div`
    width: 100%;
    display: grid;
    grid-template-columns 

`
